function Write-Log {
     [CmdletBinding()]
     Param (
          [Parameter(Mandatory = $true, ValueFromPipelineByPropertyName = $true)]
          [ValidateNotNullOrEmpty()]
          [String]$Message,
          [String]$LogPath    = "$ENV:USERPROFILE\DESKTOP\Report\Logs-$(Get-Date -Format ddMMyyyy).log",
          [String]$ReportPath = "$ENV:USERPROFILE\DESKTOP\Report",
          [ValidateSet("Error", "Warning", "Information", "Results")]
          [String]$Type       = "Information"
     )

     Begin {
          $OldVerbosePreference = $VerbosePreference
          $VerbosePreference = 'Continue'
     }

     Process {
          if (!(Test-Path $LogPath)) {
               Write-Verbose "Creating $LogPath."
               New-Item $LogPath -Force -ItemType File -ErrorVariable X -ErrorAction SilentlyContinue
               New-Item $ReportPath -Force -ItemType Directory -ErrorVariable Y -ErrorAction SilentlyContinue
               if ($X) {
                    Write-Verbose "Failed to create log file: $X"
               }
               if ($Y) {
                    Write-Verbose "Failed to create report folder : $Y"
               }
          }

          $FormattedDate = Get-Date -Format "dd-MM-yyyy HH:mm:ss"

          switch ($Type) {
               'Error' {
                    Write-Host "ERROR: $Message" -ForegroundColor DarkGreen
                    $TypeText = 'ERROR: '
               }
               'Warning' {
                    Write-Host "WARNING: $Message" -ForegroundColor Red
                    $TypeText = 'WARNING: '
               }
               'Information' {
                    Write-Host "INFO: $Message" -ForegroundColor Cyan
                    $TypeText = 'INFO: '
               }
               'Results' {
                    Write-Host "RESULTS: $Message" -ForegroundColor Green
                    $TypeText = 'RESULTS: '
               }
          }
          "[$FormattedDate][$CurrentToolVersion][$ENV:USERNAME] $TypeText $Message" | Out-File -FilePath $LogPath -Append -ErrorAction SilentlyContinue
     }

     End {
          $VerbosePreference = $OldVerbosePreference
     }
}

function Get-Popup {
[CmdletBinding()]
     Param (
          [Parameter(Mandatory = $true)]
          [String]$Message,
          [ValidateSet("Error", "Warning", "Information", "Confirmation")]
          [String]$Type = "Information"
     )

     $Window = New-Object System.Windows.Forms.Form
     $Window.StartPosition      = "CenterScreen"
     $Window.Backcolor          = $MainWindowColour
     $Window.FormBorderStyle    = 'None'
     $Window.Size = '400,350'
     $Window.add_paint({
          $border = new-object System.Drawing.Pen($BlueBtnColour, 5)
          $_.graphics.drawrectangle($border,$this.clientrectangle)
     })

     $TopPanel = New-Object System.Windows.Forms.Panel
     $TopPanel.Size = '400,25'
     $TopPanel.Location = '0,0'
     $TopPanel.Anchor = "Top, Right, Left"
     $TopPanel.BackColor = $GreyColour

     $CloseWindow                            = New-Object System.Windows.Forms.Button
     $CloseWindow.FlatStyle                  = [System.Windows.Forms.FlatStyle]::Flat
     $CloseWindow.FlatAppearance.BorderSize  = 0
     $CloseWindow.BackColor                  = $GreyColour
     $CloseWindow.Location                   = '370,0'
     $CloseWindow.Size                       = '24,24'
     $CloseWindow.Cursor                     = 'Hand'
     $CloseWindow.Anchor                     = "Right, Top"
     $CloseWindow.Add_Click({$Window.close()})

     $CloseWindow.Image = [system.convert]::FromBase64String("")

     $TitleText               = New-Object System.Windows.Forms.Label
     $TitleText.Text          = "Warning!"
     $TitleText.Location      = '5,0'
     $TitleText.Size          = '250,25'
     $TitleText.ForeColor     = $WhiteColour
     $TitleText.BackColor     = $GreyColour
     $TitleText.Font          = New-Object System.Drawing.Font("Calibri", 14)

     $OutputMessage = New-Object System.Windows.Forms.Label
     $OutputMessage.Text = "$($Message)"
     $OutputMessage.ForeColor = $WhiteColour
     $OutputMessage.Location = '7,30'
     $OutputMessage.Size = '286, 250'

     if( $Type -eq "Confirmation" ) {
          $ConfirmationBox = New-Object System.Windows.Forms.CheckBox
          $ConfirmationBox.Text = "Are you sure?"
          $ConfirmationBox.Location = '10,200'
          $ConfirmationBox.Size = '200, 35'
          $ConfirmationBox.ForeColor = $WhiteColour
          $ConfirmationBox.FlatStyle                  = [System.Windows.Forms.FlatStyle]::Flat
          $ConfirmationBox.FlatAppearance.BorderSize  = 0
    
          $Window.Controls.Add($ConfirmationBox)         
     }

     $OkayBtn = New-Object System.Windows.Forms.Button
     $OkayBtn.Text = "OKAY"
     $OkayBtn.Location = '140,300'
     $OkayBtn.Size = '115,25'
     $OkayBtn.ForeColor = $BlueBtnColour
     $OkayBtn.FlatStyle                  = [System.Windows.Forms.FlatStyle]::Flat
     $OkayBtn.FlatAppearance.BorderSize  = 0
     $OkayBtn.Cursor = "Hand"
     $OkayBtn.Add_Click({
          if ($Type -eq "Confirmation") {
               if ($ConfirmationBox.Checked -ne $true) {
                    Get-Popup -Message "Script has been cancelled due to confirmation prompt"
                    $SCRIPT:Check = "False"
               }
          }
          $Window.Close()
     })

     $Window.Controls.Add($OkayBtn)
     $Window.Controls.Add($TitleText)
     $Window.Controls.Add($TopPanel)
     $Window.Controls.Add($OutputMessage)
     [void]$Window.ShowDialog()
}

function Clear-DataGridView {
     if ($DataGridView.Row.Count -ge 1) {
          try {
               $DataGridView.Rows.Clear()
          } catch {
               Write-Host "Unable to clear"
          }
     }
}

