          [int]$newX = [Math]::Min($currentX - $SCRIPT:mouseDragX, $screenRight - $GUIWindow.Width)
          [int]$newY = [Math]::Min($currentY - $SCRIPT:mouseDragY, $screenBottom - $GUIWindow.Height)
          $GUIWindow.Location = New-Object System.Drawing.Point($newX, $newY)
     }
})

